import {getConnection} from "./../database/database";

const getLanguage = async(req,res)=>{
    try{
    const connection= await getConnection();
    const result = await connection.query("SELECT * from usuarios");
    res.json(result);
    } catch(error) {
        res.status(500);
        res.send(error.message);
    }
};
const getLanguages = async(req,res)=>{
    try{
        console.log(req.params);
        const {id}=req.params
    const connection= await getConnection();
    const result = await connection.query("SELECT * from usuarios WHERE idUsuario=?",id);
    res.json(result);
    } catch(error) {
        res.status(500);
        res.send(error.message);
    }
};



const addLanguages = async(req,res)=>{
    try{
        
        const {nombre,apellido,email}=req.body;
        if(nombre==undefined || apellido == undefined || email== undefined){
            res.status(400).json({message:"Bad Request. Please fill all fields"});
        }
        const info={
            nombre,apellido,email
        };

        const connection= await getConnection();
       
       const result = await connection.query("INSERT INTO usuarios SET ?",info);
        res.json({message:"User added"});
    } catch(error) {
        res.status(500);
        res.send(error.message);
    }
};

const deleteLanguages = async(req,res)=>{
    try{
        console.log(req.params);
        const {id}=req.params
    const connection= await getConnection();
    const result = await connection.query("DELETE FROM usuarios WHERE idUsuario=?",id);
    res.json(result);
    } catch(error) {
        res.status(500);
        res.send(error.message);
    }
};


const updateLanguages = async(req,res)=>{
    try{
        const {id}=req.params;
        const {nombre,apellido,email}=req.body;
        if(id==undefined || nombre==undefined || apellido == undefined || email== undefined){
            res.status(400).json({message:"Bad Request. Please fill all fields"});
        }
        const info={
            nombre,apellido,email
        };
    const connection= await getConnection();
    const result = await connection.query("UPDATE usuarios SET ? WHERE idUsuario=?",[info,id]);
    res.json(result);
    } catch(error) {
        res.status(500);
        res.send(error.message);
    }
};



export const methods = {
    getLanguage,
    getLanguages,
    addLanguages,
    deleteLanguages,
    updateLanguages

};

